export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:5}}},wB7GModIAl:{data:{id:992,attributes:{imdbId:"tt0039357",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNWEwZWRmNzgtNmQ0Mi00OTVlLWI1NWMtNjk4YWVkNTIwZjUwXkEyXkFqcGdeQXVyMDI2NDg0NQ@@._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"6.0\u002F10"}],item_lang:{data:{id:1655,attributes:{title:"Escape Me Never",plot:"It is Venice, 1900, and Fenella is engaged to composer Caryl Dubrok until she hears that an unmarried woman named Gemma and child is staying with a composer named Dubrok. So the engagement is off and so is she for the mountains. There she meets and is intrigued by Sebastian, but she does not know that he is the composer that Gemma is staying with. When she learns about him, Gemma demands that she choose but Fenella cannot so Gemma and Sebastian leave to be married. They go to England to write his Ballet and Caryl and Fenella are re-engaged. But Fenella still loves the fun-loving Sebastian.",slug:"escape-me-never"}}},books:{data:[{id:840,attributes:{title:"The Fool of the Family",description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=NdceAAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:true,published:"1930-01-01",publisher:"Doubleday, Doran & Gundy",subtitle:a}},{id:841,attributes:{title:"Together and Apart",description:"Betsy Canning is dissatisfied with life. She has always taken pains to be healthy, popular and well-treated, but despite her wealth, her comfortable homes and beautiful children, happiness eludes her. The problem must lie, she thinks, in her marriage to Alec, and a neat, civilised divorce seems the perfect solution. But talk of divorce sparks interference from family and friends, and soon public opinion tears into the fragile fabric of family life and private desire. Alec and Betsy's marriage will not be the only casualty, and in this newly complicated world, happiness is more elusive than ever.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=KWBdBAAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"2014-09-04",publisher:g,subtitle:a}},{id:842,attributes:{title:"Ladies of Lyndon",description:"Agatha is aware of an intensity, a powerful storm of emotion briefly awakened by a shortlived love affair with her cousin Gerald, that is entirely lacking from the successful marriage on which she is about to embark. Beautiful, young and carefully brought up, Agatha knows she is securing a perfect and luxurious future in marrying handsome John Clewer and becoming Mistress of Lyndon, and she soon becomes the perfect country house hostess. But when Gerald reappears and war in Europe disturbs the sheltered comfort of Lyndon forever, Agatha is once again haunted by the idea of a different life.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=WEsPBAAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"2014-08-07",publisher:g,subtitle:a}},{id:843,attributes:{title:"A Night in Cold Harbour",description:"Romilly Brandon was heir to a fortune and the handsomest and liveliest young man in the county. But in his twenty-first year, the pretty daughter of the local parson, Jenny Newbolt broke his heart, and he left to live a dissipated life in London. Returning years later, Romily finds many surprises - his one-time sweetheart grown old and withered, and in possession of a great secret that shakes him to his core. When Romily finally learns the truth, is it too late to atone?",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=iyvFoAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"2014-10-13",publisher:h,subtitle:a}},{id:844,attributes:{title:"Red Sky at Morning",description:"'Margaret Kennedy caught just the taste of the time, mixing a stolid domestic Englishness with 'Continental' bohemians' Irish Times William and Emily Crowne seem to have it all - they live a life of privilege and glamour in London, the children of a successful poet, attractive, happy, largely blind to the world around them. But life takes an unexpected turn when their mother dies, and their father is caught up in the most scandalous and notorious of criminal trials. Suddenly effectively orphans, their aunt takes them in, and they grow up alongside their cousins, Trevor and Charlotte. But tensions and jealousies are rife between the four, and soon the Crowne children find that their father's notoriety will follow them into their adult lives, with devastating consequences.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=F2aloAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"2014-10-16",publisher:h,subtitle:a}}]}}},meta:{}}},prerenderedAt:1682568457815}}("","Margaret Kennedy","movie",null,"series",1,"Random House","Vintage Classic"))